import { BrowserRouter, Route } from "react-router-dom";
import SingleMain from "./SingleMain";

const PaginaProducto = () => {
  return (
    <BrowserRouter>
      <Route exact path="/Producto">
        <SingleMain />
      </Route>
    </BrowserRouter>
  );
};

export default PaginaProducto;
